// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/utils/Context.sol";


contract LiberaToken is IERC20, IERC20Metadata, Context {
    address private _tokenOwner;

    string public constant name = "LiberaToken";
    string public constant symbol = "LIBE";
    uint8 public constant decimals = 18;

    uint256 private _totalSupply;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    error YouCanOnlyCheckTheBalanceOfYourWallet();
    error TransferToTheZeroAddress();
    error TransferAmountExceedsBalance();
    error ApproveToTheZeroAddress();
    error TransferFromTheZeroAddress();
    error TransferAmountExceedsAllowance();
    error IncreaseAllowanceToTheZeroAddress();
    error DecreaseAllowanceToTheZeroAddress();
    error DecreasedAllowanceBelowZero();
    error MintToZeroAddress();
    error BurnFromZeroAddress();
    error BurnAmountExceedsBalance();

    constructor() {
        _tokenOwner = msg.sender;
        uint256 initialSupply = 5000000000 * (10 ** uint256(decimals));
        // _balances[msg.sender] = _totalSupply;  // Assign all tokens to the contract deployer
        
        // emit Transfer(address(0), msg.sender, _totalSupply);
        _mint(msg.sender, initialSupply);
    }

    function tokenOwner() external view returns (address) {
        return _tokenOwner;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) external view override returns (uint256) {
        // if (tx.origin != _tokenOwner && account != tx.origin)
        //     revert YouCanOnlyCheckTheBalanceOfYourWallet();
        
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) external override returns (bool) {
        if (recipient == address(0))
            revert TransferToTheZeroAddress();
        if(_balances[tx.origin] < amount)
            revert TransferAmountExceedsBalance();

        _balances[tx.origin] -= amount; // _balances[msg.sender] -= amount;
        _balances[recipient] += amount;

        emit Transfer(tx.origin, recipient, amount);
        
        return true;
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) external override returns (bool) {
        if(spender == address(0))
            revert ApproveToTheZeroAddress();

        _allowances[tx.origin][spender] = amount; // _allowances[msg.sender][spender] = amount;

        emit Approval(tx.origin, spender, amount); // emit Approval(msg.sender, spender, amount);

        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) external override returns (bool) {
        if (sender == address(0))
            revert TransferFromTheZeroAddress();
        if (recipient == address(0))
            revert TransferToTheZeroAddress();
        if(_balances[sender] < amount)
            revert TransferAmountExceedsBalance();
        if (_allowances[sender][tx.origin] < amount)
            revert TransferAmountExceedsAllowance();

        _balances[sender] -= amount;
        _balances[recipient] += amount;
        _allowances[sender][tx.origin] -= amount; // _allowances[sender][msg.sender] -= amount;

        emit Transfer(sender, recipient, amount);
        
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        if (spender == address(0))
            revert IncreaseAllowanceToTheZeroAddress();

        _allowances[tx.origin][spender] += addedValue; // _allowances[msg.sender][spender] += addedValue;

        emit Approval(tx.origin, spender, _allowances[tx.origin][spender]); // emit Approval(msg.sender, spender, _allowances[msg.sender][spender]);
        
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        if (spender == address(0))
            revert DecreaseAllowanceToTheZeroAddress();

        uint256 currentAllowance = _allowances[tx.origin][spender]; // uint256 currentAllowance = _allowances[msg.sender][spender];

        if (currentAllowance < subtractedValue)
            revert DecreasedAllowanceBelowZero();

        _allowances[tx.origin][spender] = currentAllowance - subtractedValue; // _allowances[msg.sender][spender] = currentAllowance - subtractedValue;

        emit Approval(tx.origin, spender, _allowances[tx.origin][spender]); // emit Approval(msg.sender, spender, _allowances[msg.sender][spender]);

        return true;
    }

    function _mint(address account, uint256 amount) internal {
        if (account == address(0))
            revert MintToZeroAddress();

        _totalSupply += amount;
        _balances[account] += amount;
    
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal {
        if (account == address(0))
            revert BurnFromZeroAddress();
        if (_balances[account] < amount)
            revert BurnAmountExceedsBalance();

        _balances[account] -= amount;
        _totalSupply -= amount;
        emit Transfer(account, address(0), amount);
    }
}

